INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5905689308636', 'Gazowany napoj energetyzujący o smaku miętowo-cytrynowym', 'Big Power energy drink Mojito - gazowany napój energetyzujący o smaku miętowo-cytrynowym z tauryną i kofeiną, wzbogacony witaminami. Pasteryzowany. Wysoka zawartość kofeiny; nie zaleca się stosowania u dzieci, kobiet w ciąży i kobiet karmiących piersią (32 mg / 100ml). Niewskazany dla díabetyków i osób wrażliwych na kofeinę. Nie zaleca się mieszania z alkoholem. Pamiętaj o zrównoważonym sposobie żywienia i zdrowym trybie życia. Składniki: woda, cukier, kwas: kwas cytrynowy, dwutlenek węgla, tauryna (0,4%), regulator kwasowości: cytryniany sodu, aromaty, kofeina (0,03%), niacyna, biotyna, witamina B6 i witamina B12. Zawarte w produkcie witaminy B6, B12 oraz niacyna i kwas pantotenowy przyczyniają się do zmniejszenia uczucia zmęczenia i znużenia. Przechowywać w suchym, chłodnym i zaciemnionym miejscu. Pić schłodzone. Nie zamrażać. Spożyć bezpośrednio po otwarciu puszki.', 'https://static.openfoodfacts.org/images/products/590/568/930/8636/front_pl.4.400.jpg', '0', '0', '11', '11', '', '0.5', '0.1', '0.0393700787401575', '', '1');

