VALUES ('5907623260833', 'Sałatka warzywna a la Gyros', 'Ziemniaki, ogórek, woda, kukurydza, olej rzepakowy, mięso oddzielone mechanicznie z kurcząt, skórki z kurcząt, żołądki z kurcząt, cukier, przyprawy i ich ekstrakty (zawierają _gorczycę_, _seler_), mięso z kurczaka, cebula, ocet spirytusowy, kasza manna (z pszenicy), substancje zagęszczające: guma guar, guma ksantanowa, karagen; koncentrat pomidorowy, regulatory kwasowości: kwas mlekowy, kwas cytrynowy, kwas octowy; żółtko _jaja_ w proszku, błonnik marchwiowy, sól, skrobie modyfikowane, aromaty, substancje konserwujące: E202, E211; hydrolizat białka roślinnego (zawiera _soję_), koncentrat białka _sojowego_, warzywa suszone, wzmacniacz smaku: E621; barwnik: karoteny. Produkt może zawierać ryby, mleko, nasiona sezamu, orzechy laskowe.', 'https://static.openfoodfacts.org/images/products/590/762/326/0833/front_pl.4.400.jpg', '15', '1.9', '10', '2.9', '', '3.7', '1.4', '0.551181102362205', '', '0');

